import React from 'react';
import Card from './../../components/Card'
import icon from './../../assets/icon.png'
import { Container, Img, InputText, Bt, Label } from './index.syles';
export default function Component() {
  var app = document.getElementById("cpf");
  console.log(app)

  function handleclick(e) {
    e.preventDefault();
    var cpf = document.getElementById("cpf").value;
    var senha = document.getElementById("senha").value;
    console.log(senha)

    if (cpf > 0) {
      document.getElementById("senha").focus();
    } else {
      window.event("Digite o CPF Corretamente")
    }

  }
  return (
    <Container>
      <Card title="Login" >
        <Img src={icon} />
        <Label>CPF</Label>
        <InputText type="text" id="cpf" placeholder="CPF cadastrado" />
        <Label>Senha</Label>
        <InputText type="password" id="senha" placeholder="senha" />
        <Bt type="submit"> Enviar</Bt>

      </Card >

    </Container>
  );
}
